import React from 'react'
import ApiService from '../../services/ApiService'
import {ReactComponent as Movie} from './icons/movie.svg'
import {ReactComponent as Search} from './icons/search.svg'

export default function Header() {

  const [input, setInput] = useState([]);
  const [user, setuser] = useState([]);

  const API_URL  = 'https://api.themoviedb.org/3/movie/550?api_key=68ae61f2720168696df123e0c841e5d8';

  useEffect(() => {
    fetch(API_URL).then((response) => response.json())
    .then((data) => setuser(data));

  }, [input])
  return (
    <div>
      <header>
        <div className="search-content">
          <div className="search-wrap">
            <Movie className="movie-icon"/>
            <input type="text" placeholder="Enter Movie Name" id="search"/>
          </div>
          <Search className="search-icon"/>
        </div>
      </header>
    </div>
  )
}
